g2:c.PROCEDURE.g2:a.TEXT:
_opexpes-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces;
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _opexpes-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _opexpes-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

_make-item-public (Type: symbol)
ScBr: class sc-browser-template;
M: class opcsrui-module-storage-information;
ModuleName: symbol;
b: item-or-value;
Ws: class kb-workspace;
begin
    for M = each opcsrui-module-storage-information do
        ModuleName = the opcsrui-module-name of M;
        if ModuleName exists then begin
            b = call _devui-get-bin (ModuleName, Type);
            if b is a symbol and b = the symbol ITEM-NOT-FOUND then return;
            Ws = the subworkspace of b;
            for ScBr = each sc-browser-template upon Ws do
                if ScBr is not publically-exported-by _soft-ui-get-message-browsers then conclude that ScBr is now publically-exported-by _soft-ui-get-message-browsers;
            end;
        end;
    end;
end

_SOFT-UI-GET-DOMAIN-MAPS (MODE: Symbol) = (sequence)
objects: sequence = sequence ();
i: class item;
begin
    for i = each item that is publically-exported-by this procedure do
        objects = insert-at-beginning (objects, i);
    end;
    return objects;
end

