_SOFT-UI-GET-SERVER-DETAILS (MODE: Symbol) = (structure)
browsers: sequence = sequence ();
maps: sequence = sequence ();
objects: sequence = sequence ();
system: sequence = sequence ();
mods: sequence = sequence ();

hostName, hostPort: text;
begin
    hostName = call g2-get-host-name ();
    hostPort = call g2-get-port-number-or-name ();
    objects = call _SOFT-UI-GET-DOMAIN-OBJECTS (mode);
    browsers = call _soft-ui-get-message-browsers (mode);
    system = call _soft-ui-get-system-objects (mode);
    maps = call _soft-ui-get-domain-maps (mode);
    mods = call _cdg-find-modules (mode, true, "*", "*");
    return evaluated-structure (symbol ("[hostName][hostPort]"), sequence (structure (SYSTEM: system), structure (MODULES:mods), structure (BROWSERS: browsers), Structure (OBJECTS: objects), Structure (MAPS: maps)));
end

_SOFT-UI-GET-DOMAIN-OBJECTS (MODE: Symbol) = (sequence)
objects: sequence = sequence ();
i: class item;
begin
