        objects = insert-at-beginning (objects, i);
    end;
    return objects;
end

_CDG-FIND-MODULES (Mode: symbol, b: truth-value, TargetModule: text, key: text) = (sequence)
M, RM: class module-information;
s: sequence = sequence ();
retval: sequence = sequence ();
SysMods: sequence = sequence ();
CurrentSysMod: class _devui-opex-product-top-module-name;
TargetModuleSym: symbol;
RequiredModules: sequence;
RmIndex: integer = 0;
begin
    for CurrentSysMod = each _devui-opex-product-top-module-name do
        SysMods = insert-at-end (SysMods, the _devui-top-module-name of CurrentSysMod);
    end;
    if TargetModule /= "*" and TargetModule /= "ALL" then begin
        TargetModuleSym = symbol (TargetModule);
        {return if the user mode is not administator and the module passed in belongs to OpEx.}
        if Mode /= the symbol ADMINISTRATOR and TargetModuleSym is a member of SysMods then return retval;
        for M = each module-information do
            exit if TargetModuleSym = the top-level-module of M 
        end;
        retval = insert-at-end (retval, M);
        RequiredModules = the directly-required-modules of M;

        {Remove any module that is proprietary if the user mode is not Administrator}
        for TargetModuleSym = each symbol in RequiredModules do
            if Mode /= the symbol ADMINISTRATOR and TargetModuleSym is a member of SysMods then RequiredModules = remove (RequiredModules, RmIndex);
            RmIndex = RmIndex + 1;
        end;
        for M = each module-information do
            if the top-level-module of M is a member of RequiredModules then retval = insert-at-end (retval, M);
        end;
    end
    else begin
        for M = each module-information do
            case (Mode) of 
                ADMINISTRATOR:
                    retval = insert-at-end (retval, M);
                otherwise:
                    if the top-level-module of M is not a member of SysMods then retval = insert-at-end (retval, M);
            end;
        end;
    end;
    return retval;
end
